(9451, '<p>Several times many biodegradable and eco-friendly bags have been inaugurated all over the world but not endured due to valorization. This time Bangladeshi scientist Dr. Mubarak Ahmad Khan, presently working as scientific advisor of Bangladesh Jute Mills Corporation (BJMC) and former Chief Scientific Officer of Bangladesh Atomic Energy Commission invented a biodegradable and eco-friendly bag from jute cellulose which is being considered as a great achievement for Bangladesh. So far no official name is given to this bag but soon a proposal will be given to the ministries to name it as &lsquo;Sonali Bag&rsquo;.</p>', '<p>Several times many biodegradable and eco-friendly bags have been inaugurated all over the world but not endured due to valorization. This time Bangladeshi scientist Dr. Mubarak Ahmad Khan, presently working as scientific advisor of Bangladesh Jute Mills Corporation (BJMC) and former Chief Scientific Officer of Bangladesh Atomic Energy Commission invented a biodegradable and eco-friendly bag from jute cellulose which is being considered as a great achievement for Bangladesh. So far no official name is given to this bag but soon a proposal will be given to the ministries to name it as &lsquo;Sonali Bag&rsquo;.</p><br><p>Source : <a href=\'http://tutorialbd.com/english/bangladesh-invented-bio-plastic-from-jute\'>http://tutorialbd.com/english/bangladesh-invented-bio-plastic-from-jute</a></p>', 'http://tutorialbd.com/english/bangladesh-invented-bio-plastic-from-jute', '', 'Bangladesh invented Bio-plastic from jute | TutorialBD', 'Bangladesh invented Bio-plastic from jute | TutorialBD', 'bangladesh-invented-bio-plastic-from-jute-tutorialbd-9451', 5, 1, '2019-09-25 09:31:28', '2020-04-20 09:34:26'),
