aecare &reg;] without dilating the cervix hence substantially reducing pain as well as chances of complications.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal; tab-stops: .25in .5in .75in 1.0in 1.25in 1.5in 1.75in 2.0in 2.25in 2.5in 2.75in 3.0in 3.25in 3.5in 3.75in 4.0in 4.25in 4.5in 4.75in 5.0in 5.25in 5.5in 5.75in 6.0in 6.25in 6.5in 6.75in 7.0in 7.25in 7.5in 7.75in 8.0in; mso-layout-grid-align: none; text-autospace: none;\"><strong style=\"mso-bidi-font-weight: normal;\"><span style=\"font-size: 12.0pt; font-family: \'Cambria\',\'serif\'; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: \'Segoe Print\';\">Operative Laparoscopy &amp; Hysteroscopy</span></strong></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal; tab-stops: .25in .5in .75in 1.0in 1.25in 1.5in 1.75in 2.0in 2.25in 2.5in 2.75in 3.0in 3.25in 3.5in 3.75in 4.0in 4.25in 4.5in 4.75in 5.0in 5.25in 5.5in 5.75in 6.0in 6.25in 6.5in 6.75in 7.0in 7.25in 7.5in 7.75in 8.0in; mso-layout-grid-align: none; text-autospace: none;\"><span style=\"font-size: 12.0pt; font-family: \'Cambria\',\'serif\'; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin; mso-bidi-font-family: \'Segoe Print\';\">Myomectomies, septal resections , endometrioma excision,<span style=\"mso-spacerun: yes;\">&nbsp; </span>tubal recanalization, PCO drilling,ovarian cystectomies,<span style=\"mso-spacerun: yes;\">&nbsp; </span>lateral metroplasty and any other fertility enhancing or<span style=\"mso-spacerun: yes;\">&nbsp; </span>corrective surgery is done laparoscopically and / or hysteroscopically routinely at Genesis.</span><span style=\"font-family: Cambria, serif; font-size: 12pt;\">&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: .0001pt; line-height: normal; tab-stops: .25in .5in .75in 1.0in 1.25in 1.5in 1.75in 2.0in 2.25in 2.5in 2.75in 3.0in 3.25in 3.5in 3.75in 4.0in 4.25in 4.5in 4.75in 5.0in 5.25