(9556, '<h1><span style=\"font-weight: 900;\">What is Digital Marketing?</span></h1>\n<p><span style=\"font-weight: 300;\">You&rsquo;ve probably heard of digital/online/internet marketing before. But since you&rsquo;re reading this, you&rsquo;re not exactly an expert. And that&rsquo;s alright, we all start somewhere.</span></p>\n<p><span style=\"font-weight: 300;\">The bad news is, digital marketing is extremely complex &ndash; the good news is, digital marketing doesn&rsquo;t have to be complicated.</span></p>\n<p><span style=\"font-weight: 300;\">People send their entire lives mastering just one aspect of digital marketing, and its always changing &ndash; but you can learn it without your head spinning if you know where to start and stay focused (hint: you&rsquo;re in the right place).</span></p>', '<h1><span style=\"font-weight: 900;\">What is Digital Marketing?</span></h1>\n<p><span style=\"font-weight: 300;\">You&rsquo;ve probably heard of digital/online/internet marketing before. But since you&rsquo;re reading this, you&rsquo;re not exactly an expert. And that&rsquo;s alright, we all start somewhere.</span></p>\n<p><span style=\"font-weight: 300;\">The bad news is, digital marketing is extremely complex &ndash; the good news is, digital marketing doesn&rsquo;t have to be complicated.</span></p>\n<p><span style=\"font-weight: 300;\">People send their entire lives mastering just one aspect of digital marketing, and its always changing &ndash; but you can learn it without your head spinning if you know where to start and stay focused (hint: you&rsquo;re in the right place).</span></p><br><p>Source : <a href=\'http://www.edustudy.org/blogs/detail/digital-marketing-for-dummies-everything-you-need-to-know-to-get-started-68\'>http://www.edustudy.org/blogs/detail/digital-marketing-for-dummies-everything-you-need-to-know-to-get-started-68</a></p>', 'http://www.edustudy.org/blogs/detail/digital-marketing-for-dummies-everything-you-need-to-know-to-get-started-68', '', 'Digital Marketing for Dummies: Everything You Need to Know to Get Started | eduStudy', 'Digital Marketing for Dummies: Everything You Need to Know to Get Started | eduStudy', 'digital-marketing-for-dummies-everything-you-need-to-know-to-get-started-edustudy-9556', 5, 1, '2019-12-22 04:11:11', '2020-04-20 09:36:28'),
