(9569, '<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">Dr. Benoy N.J is a renowned Ayurvedic Psychiatrist and Physician. He graduated BAMS from SJS Ayurveda Medical College in Chennai.</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">He started his Ayurvedic practice from Sri Narayana Ayurveda Hospital and Pharmacy in Kanchipuram, Tamil Nadu. He rendered his yeomen service in both private and Government hospitals more than 18 years in Kerala and other states. During this period he imparted his Knowledge in fundamentals of Ayurveda and Ayurvedic medicine preparation with numerous junior doctors. For a period of 3 years he dedicated his service as a course director for Ayurveda Nursing Course in Ayushalaya Hospital and Nursing College, Kattappana.</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">Dr. Benoy received the Best Ayurvedic Doctor KKU Award from Jayendra Saraswathi Ayurveda College. He earned MD in Ayurveda Psychiatry from Kerala University of Health Sciences in Thrissur in the year 2014.</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">Dr. Benoy conducted more than 3500 lectures in India and abroad regarding Ayurveda and also about the philosophy of Sri. Narayanaguru, the spiritual leader and social reformer in Kerala. He used to conduct group counselling classes for students, teachers and parents in many reputed institutions. Dr. Benoy is an expert in taking classes in Anatomy Physiology and Yoga therapy for foreign students. He is a successful counsellor in personal, pre-marital and post-marital counselling.</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">There are many articles and Television programmes in the account of this erudite scholar. At present he is the Director and Chief Physician of Ayuryoga Gurukulam in Ernakulam, Kerala.</p>', '<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">Dr. Benoy N.J is a renowned Ayurvedic Psychiatrist and Physician. He graduated BAMS from SJS Ayurveda Medical College in Chennai.</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">He started his Ayurvedic practice from Sri Narayana Ayurveda Hospital and Pharmacy in Kanchipuram, Tamil Nadu. He rendered his yeomen service in both private and Government hospitals more than 18 years in Kerala and other states. During this period he imparted his Knowledge in fundamentals of Ayurveda and Ayurvedic medicine preparation with numerous junior doctors. For a period of 3 years he dedicated his service as a course director for Ayurveda Nursing Course in Ayushalaya Hospital and Nursing College, Kattappana.</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">Dr. Benoy received the Best Ayurvedic Doctor KKU Award from Jayendra Saraswathi Ayurveda College. He earned MD in Ayurveda Psychiatry from Kerala University of Health Sciences in Thrissur in the year 2014.</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">Dr. Benoy conducted more than 3500 lectures in India and abroad regarding Ayurveda and also about the philosophy of Sri. Narayanaguru, the spiritual leader and social reformer in Kerala. He used to conduct group counselling classes for students, teachers and parents in many reputed institutions. Dr. Benoy is an expert in taking classes in Anatomy Physiology and Yoga therapy for foreign students. He is a successful counsellor in personal, pre-marital and post-marital counselling.</p>\n<p style=\"box-sizing: inherit; margin: 0px 0px 10px; line-height: 26px; letter-spacing: 0.5px; font-size: 14px; color: #777777; font-family: Roboto, sans-serif; background-color: #ffffff;\">There are many articles and Television programmes in the account of this erudite scholar. At present he is the Director and Chief Physician of Ayuryoga Gurukulam in Ernakulam, Kerala.</p><br><p>Source : <a href=\'http://www.ayuryogaguru.com/\'>http://www.ayuryogaguru.com/</a></p>', 'http://www.ayuryogaguru.com/', '', 'Home Page - Ayuryoga Gurukulam', 'Home Page - Ayuryoga Gurukulam', 'home-page-ayuryoga-gurukulam-9569', 5, 1, '2020-02-04 10:40:39', '2020-04-20 09:36:42'),
