(9625, '<p><span style=\"color: #757575; font-family: Calibri, sans-serif; font-size: 14.6667px; -webkit-text-stroke: 1px rgba(0, 0, 0, 0); background-color: #ffffff;\">As every brand wants to continue to own and grow its presence with the audience, companies are getting on board to hire voice artists for different accents, dialects and languages. Videos and ad campaigns are increasingly being designed in various accents to engage and communicate with the audience, rather than simply talk to them. From audiobooks, webinars and podcasts to &lsquo;mind the gap&rsquo; on the subway, recorded voices have become a daily part of our lives.</span></p>', '<p><span style=\"color: #757575; font-family: Calibri, sans-serif; font-size: 14.6667px; -webkit-text-stroke: 1px rgba(0, 0, 0, 0); background-color: #ffffff;\">As every brand wants to continue to own and grow its presence with the audience, companies are getting on board to hire voice artists for different accents, dialects and languages. Videos and ad campaigns are increasingly being designed in various accents to engage and communicate with the audience, rather than simply talk to them. From audiobooks, webinars and podcasts to &lsquo;mind the gap&rsquo; on the subway, recorded voices have become a daily part of our lives.</span></p><br><p>Source : <a href=\'https://www.voyzapp.com/blog/accent-why-is-it-so-important-in-voice-overs\'>https://www.voyzapp.com/blog/accent-why-is-it-so-important-in-voice-overs</a></p>', 'https://www.voyzapp.com/blog/accent-why-is-it-so-important-in-voice-overs', '', 'Accent! Why is it so important in voice-overs? - Voyzapp', 'Accent! Why is it so important in voice-overs? - Voyzapp', 'accent-why-is-it-so-important-in-voice-overs-voyzapp-9625', 2893, 1, '2020-02-22 01:57:55', '2020-04-20 09:37:48'),
