(9717, NULL, '<p>Proteas are back to India after 4 years where they had been white washed back then. And this time, they arrived without the services of two superstars ABD and Steyn. Proteas away record( not losing an away series from 2005-2014) had been cleaned up by India last time .</p><p><br></p><p>Proteas are good traveling side till 2015,Proteas being a pace battery side always prone to spin attack and it\'s difficult for them to face spin in sub continent conditions.</p><p><br></p><p>India will be missing their main bowler bumrah , but since home conditions favouring&nbsp;spin , they have Ashwin Jadeja duo to pose a serious threat to the proteas.</p><p><br></p><p>India also testing a new opener Rohit Sharma who didn\'t open in any of his previous test match.&nbsp;</p><p><br></p><p>And last time when they toured India, we can\'t forget the Nagpur test where thirty three of&nbsp;the 40 wickets went to spinners &amp; completed withinn 3 days &amp; no batsman from either side made a half century. ICC rated that pitch as poor.</p><p><br></p><p>Again the pitch issue came when India toured South Africa in 2018. Johannesburg test match between India &amp; south Africa was full of surprises. India eventually won that match on a tough pitch where proteas batsman told pitch wasn\'t suitable for batting due to uneven bounce and many got blows as well. But umpires intervened &amp; informed the pitch as normal continuing&nbsp;the match as scheduled</p><p><br></p><p>So this series will also be a more of&nbsp;battle of pitches than battle of players.</p><p><br></p><p>Players to watch out&nbsp;</p><p>Rabada vs Kohli</p><p>De Kock vs Ashwin</p><p><br></p><p><br></p><p>By Dinesh Kumar P</p><p>-- Proteas lover</p><p><br></p><p>Photos courtesy : hindustantimes</p><p><br></p><p>*Stay updated on statsbuzz.com to know more about unique cricket statistics and analysis.</p><p><br></p><p><a href=\"https://www.statsbuzz.com/bites/proteas-are-back-to-india-after-4-years-2\" rel=\"noopener noreferrer\" target=\"_blank\">https://www.statsbuzz.com/bites/proteas-are-back-to-india-after-4-years-2</a></p>', NULL, 'assets/images/posts/Proteas-are-back-to-India-after-4-years-AyBdfa09I1MWHacOg7blXoG46NZYzBfrgKEci0ae.jpeg', NULL, 'Proteas are back to India after 4 years', 'Proteas-are-back-to-India-after-4-years-9717', 5, 1, '2020-05-05 20:18:18', '2020-05-05 20:18:18'),
